// src/components/ResumeAnalyzer.js
import React, { useState } from 'react';
import { useDropzone } from 'react-dropzone';
import axios from 'axios';
import { Bar } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function ResumeAnalyzer({ onSignOut }) {
    const [file, setFile] = useState(null);
    const [analysis, setAnalysis] = useState(null);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);

    const onDrop = (acceptedFiles) => {
        const uploadedFile = acceptedFiles[0];
        if (uploadedFile) {
            setFile(uploadedFile);
            setAnalysis(null);
            setError(null);
        }
    };

    const { getRootProps, getInputProps, isDragActive } = useDropzone({
        onDrop,
        accept: {
            'application/pdf': ['.pdf'],
            'application/vnd.openxmlformats-officedocument.wordprocessingml.document': ['.docx'],
        }
    });

    const handleAnalyze = async () => {
        if (!file) {
            setError("Please select a file to analyze.");
            return;
        }
        
        setLoading(true);
        setError(null);
        const formData = new FormData();
        formData.append('resume', file);

        try {
            const response = await axios.post('http://localhost:5000/api/analyze-resume', formData, {
                headers: {
                    'Content-Type': 'multipart/form-data',
                },
            });
            setAnalysis(response.data);
        } catch (err) {
            console.error("Analysis error:", err);
            setError("Failed to analyze resume. Please check the backend server.");
            setAnalysis(null);
        } finally {
            setLoading(false);
        }
    };

    const handleHelp = () => {
        alert("This is a resume analysis tool. Upload a PDF or DOCX file to get insights on your skills and career path.");
    };

    const chartData = analysis?.trendingSkills && {
        labels: analysis.trendingSkills.map(s => s[0]),
        datasets: [
            {
                label: 'Trending Skills in Jobs',
                data: analysis.trendingSkills.map(s => s[1]),
                backgroundColor: 'rgba(54, 162, 235, 0.5)',
                borderColor: 'rgba(54, 162, 235, 1)',
                borderWidth: 1,
            },
            {
                label: 'Your Skills',
                data: analysis.trendingSkills.map(s => analysis.skills.includes(s[0]) ? s[1] : 0),
                backgroundColor: 'rgba(75, 192, 192, 0.5)',
                borderColor: 'rgba(75, 192, 192, 1)',
                borderWidth: 1,
            },
        ],
    };

    const chartOptions = {
      responsive: true,
      plugins: {
        legend: { position: 'top' },
        title: { display: true, text: 'Your Skills vs. Trending Skills' },
      },
    };

    return (
        <main>
            <div className="button-container">
                <button onClick={onSignOut} className="header-button">Logout</button>
                <button onClick={handleHelp} className="header-button">Help</button>
            </div>
            <div className="upload-container">
                <div {...getRootProps()} className={`dropzone ${isDragActive ? 'active' : ''}`}>
                    <input {...getInputProps()} />
                    {isDragActive ? (
                        <p>Drop the files here ...</p>
                    ) : (
                        <p>Drag 'n' drop a resume file here, or click to select one</p>
                    )}
                </div>
                {file && (
                    <div className="file-info">
                        <p>Selected file: <strong>{file.name}</strong></p>
                        <button onClick={handleAnalyze} disabled={loading}>
                            {loading ? 'Analyzing...' : 'Analyze Resume'}
                        </button>
                    </div>
                )}
            </div>
            {error && <div className="error-message">{error}</div>}
            {analysis && (
                <div className="analysis-results">
                    <h2>Analysis Results</h2>
                    
                    <h3>Trending Job Certification Courses</h3>
                    {analysis.trendingCourses && analysis.trendingCourses.length > 0 ? (
                        <ul>
                            {analysis.trendingCourses.map((course, index) => (
                                <li key={index}>
                                    <strong>{course.skill}</strong>: {course.course}
                                </li>
                            ))}
                        </ul>
                    ) : (
                        <p>No course recommendations for trending skills available.</p>
                    )}
                    <hr/>

                    <h3>Resume Skills vs. Trending Jobs</h3>
                    <p>This chart compares your skills with skills currently in demand based on job market trends.</p>
                    {analysis.trendingSkills && analysis.trendingSkills.length > 0 ? (
                        <div style={{ width: '80%', margin: 'auto' }}>
                            <Bar data={chartData} options={chartOptions} />
                        </div>
                    ) : (
                        <p>No trending skills data available to visualize.</p>
                    )}
                    <hr/>

                    <h3>Current Job Openings</h3>
                    {analysis.currentJobs && analysis.currentJobs.length > 0 ? (
                        <ul>
                            {analysis.currentJobs.map((job, index) => (
                                <li key={index}>
                                    <strong>{job.title}</strong> at {job.company} - {job.location}
                                    <br/>
                                    <small>Posted: {job.posted_at}</small>
                                    <p>{job.description.substring(0, 150)}...</p>
                                    <a href={job.apply_link} target="_blank" rel="noopener noreferrer">Apply Now</a>
                                </li>
                            ))}
                        </ul>
                    ) : (
                        <p>No current job openings found. Please check your SERP API key or search query.</p>
                    )}
                    <hr/>

                    <h3>Skills Identified</h3>
                    <ul>
                        {analysis.skills.map((skill, index) => (
                            <li key={index}>{skill}</li>
                        ))}
                    </ul>

                    <h3>Job Matches</h3>
                    {analysis.jobMatches.length > 0 ? (
                        <ul>
                            {analysis.jobMatches.map((job, index) => (
                                <li key={index}>
                                    <strong>{job.title}</strong>: {job.matchPercentage}% match
                                    {job.matchingSkills.length > 0 && (
                                        <p>Matching skills: {job.matchingSkills.join(', ')}</p>
                                    )}
                                </li>
                            ))}
                        </ul>
                    ) : (
                        <p>No job matches found based on your skills.</p>
                    )}
                    
                    <h3>Skill Gaps</h3>
                    {analysis.skillGaps.length > 0 ? (
                        <ul>
                            {analysis.skillGaps.map((gap, index) => (
                                <li key={index}>{gap}</li>
                            ))}
                        </ul>
                    ) : (
                        <p>No significant skill gaps found.</p>
                    )}

                    <h3>Course Recommendations</h3>
                    {analysis.recommendations.length > 0 ? (
                        <ul>
                            {analysis.recommendations.map((rec, index) => (
                                <li key={index}>
                                    <strong>{rec.skill}</strong>: {rec.course}
                                </li>
                            ))}
                        </ul>
                    ) : (
                        <p>No course recommendations at this time.</p>
                    )}
                </div>
            )}
        </main>
    );
}

export default ResumeAnalyzer;
